// Main app component

//Module import
import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from '../Home/Home';
import About from '../About/About';

//Styles import

import './App.css';

//App component
class App extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}
	render() {
		return (
			<Router>
				<nav>
					<Link to="/">Home</Link>
					<Link to="About">About</Link>
				</nav>

				<Switch>
					<Route path="/About">
						<About></About>
					</Route>

					<Route path="/">
						<Home></Home>
					</Route>
				</Switch>
			</Router>
		);
	}
}

export default App;
